return ['project-id-version'=>'Nexi XPay 7.4.0','report-msgid-bugs-to'=>'https://wordpress.org/support/plugin/cartasi-x-pay','last-translator'=>'','language-team'=>'Polish','mime-version'=>'1.0','content-type'=>'text/plain; charset=UTF-8','content-transfer-encoding'=>'8bit','pot-creation-date'=>'2024-12-16T13:23:23+00:00','po-revision-date'=>'2025-01-13 13:44+0000','x-generator'=>'Loco https://localise.biz/','x-domain'=>'woocommerce-gateway-nexi-xpay','language'=>'pl_PL','plural-forms'=>'nplurals=3; plural=(n==1 ? 0 : n%10 >= 2 && n%10<=4 &&(n%100<10||n%100 >= 20)? 1 : 2);','x-loco-version'=>'2.6.14; wp-6.7.1','messages'=>['Nexi XPay'=>'Nexi XPay','Payment plugin for payment cards and alternative methods. Powered by Nexi.'=>'Wtyczka płatności dla kart płatniczych i alternatywnych metod. Obsługiwana przez Nexi.','Nexi SpA'=>'Nexi SpA','https://www.nexi.it'=>'https://www.nexi.it','Nexi payment details'=>'Szczegóły płatności Nexi','XPay payment details'=>'Szczegóły płatności XPay','Euros'=>'Euro','Czech Kurun'=>'Czeski Kurun','Zloty'=>'Złoty','Dollars'=>'Dolary','Missing codTrans'=>'Brakuje codTrans','Pay securely by credit, debit and prepaid card. Powered by Nexi.'=>'Płać bezpiecznie kartą kredytową, debetową i przedpłaconą. Obsługiwane przez Nexi.','Invalid credentials. Check and try again.'=>'Nieprawidłowe dane uwierzytelniające. Sprawdź i spróbuj ponownie.','Invalid API Key. Check and try again.'=>'Nieprawidłowy klucz API. Sprawdź i spróbuj ponownie.','For a correct behavior of the module, check in the configuration section of the Nexi back-office that the transaction cancellation in the event of a failed notification is set.'=>'Aby moduł działał prawidłowo, należy sprawdzić w sekcji konfiguracji zaplecza Nexi, czy ustawiono opcję anulowania transakcji w przypadku nieudanego powiadomienia.','A POST notification by the Nexi servers is sent to the following address, containing information on the outcome of the payment.'=>'Serwery Nexi wysyłają na poniższy adres powiadomienie POST zawierające informacje o wyniku płatności.','The notification is essential for the functioning of the plugin, it is therefore necessary that it is not blocked or filtered by the site infrastructure.'=>'Powiadomienie jest niezbędne do działania wtyczki, dlatego konieczne jest, aby nie było blokowane lub filtrowane przez infrastrukturę witryny.','The 3D Secure 2 protocol adopted by the main international circuits (Visa, MasterCard, American Express), introduces new authentication methods, able to improve and speed up the cardholder\'s purchase experience.'=>'Protokół 3D Secure 2 przyjęty przez główne międzynarodowe systemy płatności (Visa, MasterCard, American Express) wprowadza nowe metody uwierzytelniania, które mogą usprawnić i przyspieszyć proces zakupów dla posiadacza karty.','By activating this option it is established that the terms and conditions that you submit to your customers, with particular reference to the privacy policy, are foreseen to include the acquisition and processing of additional data provided by the'=>'Aktywując tę opcję ustala się, że warunki, które przekazujesz swoim klientom, ze szczególnym uwzględnieniem polityki prywatności, mają obejmować gromadzenie i przetwarzanie dodatkowych danych dostarczonych przez','3D Secure 2 Service'=>'Usługa 3D Secure 2','(for example, shipping and / or invoicing address, payment details). Nexi and the International Circuits use the additional data collected separately for the purpose of fraud prevention.'=>'(na przykład adres wysyłki i/lub fakturowania, dane dotyczące płatności). Nexi i International Circuits wykorzystują dodatkowe dane zebrane oddzielnie w celu zapobiegania oszustwom.','Enable/Disable'=>'Włącz/Wyłącz','Enable Nexi XPay payment plugin.'=>'Włącz wtyczkę płatniczą Nexi XPay.','Choose the type of credentials you have available for XPay'=>'Wybierz typ danych uwierzytelniających, które masz dostępne dla XPay','Alias and MAC Key'=>'Alias i klucz MAC','APIKey'=>'Klucz API','Select "Alias and MAC Key" option if you received the credentials of the production environment in the Welcome Mail received from Nexi during the activation of the service'=>'Wybierz opcję „Alias i klucz MAC”, jeśli dane uwierzytelniające środowiska produkcyjnego otrzymałeś w wiadomości powitalnej od Nexi podczas aktywacji usługi','Select "APIKey" option if you use the API Key as the credential of the production environment generated from the Back Office XPay. Follow the directions in the developer portal for the correct generation process.'=>'Wybierz opcję „APIKey”, jeśli używasz klucza API jako poświadczenia środowiska produkcyjnego wygenerowanego z Back Office XPay. Postępuj zgodnie ze wskazówkami w portalu deweloperskim, aby uzyskać prawidłowy proces generowania.','Alias'=>'Alias','Given to Merchant by Nexi.'=>'Podarowany Kupcowi przez Nexi.','Key MAC'=>'Klucz MAC','API Key'=>'Klucz API','Generated from the Back Office XPay. Follow the directions in the developer portal for the correct generation process.'=>'Wygenerowano z Back Office XPay. Postępuj zgodnie ze wskazówkami w portalu dewelopera, aby uzyskać prawidłowy proces generowania.','Enable/Disable TEST Mode'=>'Włącz/wyłącz tryb TEST','Enable Nexi XPay plugin in testing mode.'=>'Włącz wtyczkę Nexi XPay w trybie testowym.','Please register at'=>'Proszę zarejestrować się pod adresem','to get the test credentials.'=>'aby otrzymać uprawnienia testowe.','Please refer to Dev Portal to get access to the Sandbox'=>'Aby uzyskać dostęp do Sandboxa, zapoznaj się z Portalem Deweloperskim','Capture method'=>'Metoda przechwytywania','Immediate'=>'Natychmiastowy','Deferred'=>'Odroczony','The field identifies the collection method that the merchant wants to apply to the single transaction, if valued with:<br>- I (immediate) the transaction if authorized is also collected without further intervention by the operator and without considering the default profile set on the terminal.<br>- D (deferred) or the field is not inserted the transaction if authorized is managed according to what is defined by the terminal profile'=>'Pole identyfikuje metodę pobierania, którą sprzedawca chce zastosować do pojedynczej transakcji, jeśli ma wartość:<br>- I (natychmiastowa) transakcja, jeśli autoryzowana, jest również pobierana bez dalszej interwencji operatora i bez uwzględniania domyślnego profilu ustawionego w terminalu.<br>- D (odroczona) lub pole nie jest wstawione transakcja, jeśli autoryzowana jest zarządzana zgodnie z tym, co jest zdefiniowane w profilu terminala.','Enable 3D Secure 2 service'=>'Włącz usługę 3D Secure 2','Enable the sending of the fields for the 3D Secure 2 service'=>'Włącz wysyłanie pól dla usługi 3D Secure 2','Enable/Disable OneClick'=>'Włącz/wyłącz OneClick','Enable Nexi XPay for OneClick payment'=>'Włącz Nexi XPay dla płatności OneClick','Enable Nexi XPay for OneClick payment. Make sure that this option is also enabled on your terminal configuration.'=>'Włącz Nexi XPay dla płatności OneClick. Upewnij się, że ta opcja jest również włączona w konfiguracji terminala.','Enable/Disable Multicurrency'=>'Włącz/wyłącz obsługę wielu walut','Enable Nexi XPay for Multicurrency payments'=>'Włącz Nexi XPay dla płatności wielowalutowych','Enable this option to make the payment methods available for different currencies. To have the complete list of the supported currencies, please visit the developer Portal. Make sure that this option is also enabled on your terminal configuration.'=>'Włącz tę opcję, aby udostępnić metody płatności dla różnych walut. Aby uzyskać pełną listę obsługiwanych walut, odwiedź Portal dewelopera. Upewnij się, że ta opcja jest również włączona w konfiguracji terminala.','Enable/Disable Installment Payments'=>'Włącz/wyłącz płatności ratalne','Enable this option to use installment payments via XPay. This functionality is only available to merchants with Greek VAT Number. Before enabling this functionality, make sure it is available on your terminal with your payment provider.'=>'Włącz tę opcję, aby korzystać z płatności ratalnych za pośrednictwem XPay. Ta funkcjonalność jest dostępna tylko dla sprzedawców z greckim numerem VAT. Przed włączeniem tej funkcjonalności upewnij się, że jest ona dostępna na Twoim terminalu u Twojego dostawcy płatności.','Maximum number of installments regardless of the total order amount'=>'Maksymalna liczba rat bez względu na całkowitą kwotę zamówienia','1 to 99 installments, 1 for one shot payment. Before set up a configuration, make sure to check with your payment provider what is the maximum number accepted for your terminal.'=>'Od 1 do 99 rat, 1 za jednorazową płatność. Przed skonfigurowaniem konfiguracji upewnij się, że sprawdziłeś u swojego dostawcy płatności, jaka jest maksymalna liczba akceptowana dla Twojego terminala.','Maximum number of installments depending on the total order amount'=>'Maksymalna liczba rat uzależniona od całkowitej kwoty zamówienia','Add amount and installments for each row. The installments limit is 99'=>'Dodaj kwotę i raty dla każdego wiersza. Limit rat wynosi 99','Style configuration'=>'Konfiguracja stylu','By using this configurator you can change the look and feel of your module'=>'Za pomocą tego konfiguratora możesz zmienić wygląd swojego modułu','Preview'=>'Zapowiedź','Font family'=>'Rodzina czcionek','The font family in the CC Form'=>'Rodzina czcionek w formularzu CC','Font size'=>'Rozmiar czcionki','The size of the font in the CC Form in pixel'=>'Rozmiar czcionki w formularzu CC w pikselach','Font style'=>'Styl czcionki','Font style in the CC Form'=>'Styl czcionki w formularzu CC','Font variant'=>'Wariant czcionki','Font variant in the CC Form'=>'Wariant czcionki w formularzu CC','Letter spacing'=>'Odstępy między literami','The space between letters in pixel'=>'Odstęp między literami w pikselach','Border Color'=>'Kolor obramowania','When form is empty or correct'=>'Gdy formularz jest pusty lub poprawny','Error Border Color'=>'Błąd koloru obramowania','When form has erro