nt directly from your bank account with Przelewy24'=>'Bezpieczna płatność bezpośrednio z Twojego konta bankowego za pomocą Przelewy24','Pay quickly and easily with your Skrill wallet'=>'Płać szybko i łatwo za pomocą portfela Skrill','Pay in one tap with your Skrill wallet'=>'Zapłać jednym dotknięciem za pomocą portfela Skrill','Secure payment directly from your bank account with PayU'=>'Bezpieczna płatność bezpośrednio z Twojego konta bankowego za pomocą PayU','Secure payment directly from your home banking with Blik'=>'Bezpieczna płatność bezpośrednio z bankowości domowej dzięki Blik','Secure payment directly from your home banking with Multibanco'=>'Bezpieczna płatność bezpośrednio z Twojego konta bankowego w domu dzięki Multibanco','Pay easily with your Satispay account'=>'Płać łatwo za pomocą swojego konta Satispay','Pay easily with your Amazon account'=>'Płać łatwo za pomocą swojego konta Amazon','Pay securely with your PayPal account'=>'Płać bezpiecznie za pomocą swojego konta PayPal','Pay in 3 or 4 installments by credit, debit or Postepay card with Oney'=>'Zapłać w 3 lub 4 ratach kartą kredytową, debetową lub Postepay za pomocą Oney','Pay in 3 installments with Klarna interest-free'=>'Zapłać w 3 ratach za pomocą Klarna bez odsetek','Buy now and pay a little by little with PagoDIL'=>'Kup teraz i płać stopniowo dzięki PagoDIL','Pay in installments with HeyLight'=>'Płać w ratach z HeyLight','Pay in 3 installments with PayPal'=>'Zapłać w 3 ratach za pomocą PayPal','Error while checking credentials.'=>'Wystąpił błąd podczas sprawdzania uprawnień.','Unable to initialize the payment.'=>'Nie można zainicjować płatności.','Unable to retrive customer related info.'=>'Nie można pobrać informacji dotyczących klienta.','Customer not found.'=>'Klient nie został znaleziony.','NPG orderId not found for order: '=>'Nie znaleziono orderId NPG dla zamówienia:','Unable to retrive order related info.'=>'Nie można pobrać informacji dotyczących zamówienia.','Order not found.'=>'Nie znaleziono zamówienia.','Unable to complete refund operation.'=>'Nie można dokończyć operacji zwrotu pieniędzy.','Unable to complete capture operation.'=>'Nie można ukończyć operacji przechwytywania.','Unable to perform the recurring payment.'=>'Nie można wykonać płatności cyklicznej.','Unable to finalize the payment.'=>'Nie można sfinalizować płatności.','APMs do not have a custom configuration. '=>'APM-y nie posiadają niestandardowej konfiguracji.','Please use '=>'Proszę użyć',' configurations'=>'konfiguracje','Payment cards'=>'Karty płatnicze','Payment gateway.'=>'Bramka płatności.','New payment methods can only be added during checkout.'=>'Nowe metody płatności można dodawać wyłącznie podczas realizacji transakcji.','Installments'=>'Raty','One time solution'=>'Rozwiązanie jednorazowe','Attention, the order for which you are making payment contains recurring payments, payment data will be stored securely by Nexi.'=>'Uwaga, zamówienie, za które dokonujesz płatności, zawiera płatności cykliczne, dane dotyczące płatności będą bezpiecznie przechowywane przez Nexi.','Remember the payment option.'=>'Zapamiętaj opcję płatności.','New payment methods can only be added during checkout'=>'Nowe metody płatności można dodawać wyłącznie podczas realizacji transakcji','Error during payment proccess'=>'Wystąpił błąd podczas procesu płatności','Invalid refund amount.'=>'Nieprawidłowa kwota zwrotu.','Payment error'=>'Błąd płatności','Payment has been cancelled.'=>'Płatność została anulowana.','Invalid amount.'=>'Nieprawidłowa kwota.','Response KO'=>'Odpowiedź KO','Mac verification failed'=>'Weryfikacja Mac nie powiodła się','Error in the calculation of the return MAC parameter'=>'Błąd w obliczeniu parametru zwrotnego MAC','Can\'t connect!'=>'Nie można się połączyć!','CURL exec error: %s'=>'Błąd wykonania CURL: %s','JSON error'=>'Błąd JSON','Pay in installments without interest'=>'Płać w ratach bez odsetek',' via Nexi XPay'=>'za pośrednictwem Nexi XPay','Amount: %s installments of %s€'=>'Kwota: %s rat po %s€','The transaction has been declined, please retry.'=>'Transakcja została odrzucona. Spróbuj ponownie.','Nexi XPay payment and card tokenization successful'=>'Płatność Nexi XPay i tokenizacja kart zakończyły się sukcesem','Nexi XPay payment with tokenized card successful'=>'Płatność Nexi XPay kartą tokenizowaną powiodła się','Nexi XPay payment successful'=>'Płatność Nexi XPay powiodła się','Payment denied, please retry the transaction using the same card.'=>'Płatność odrzucona. Spróbuj ponownie dokonać transakcji przy użyciu tej samej karty.','Thank you for shopping with us. However, the transaction has been declined.'=>'Dziękujemy za zakupy u nas. Jednak transakcja została odrzucona.','%1$s ending in %2$s (expires %3$s/%4$s)'=>'%1$s kończący się na %2$s (wygasa %3$s/%4$s)','It was not possible to process the payment, check that the shipping address set is correct.'=>'Nie udało się zrealizować płatności. Sprawdź czy podany adres wysyłki jest poprawny.','Payment canceled: '=>'Płatność anulowana:','Unable to capture order %s. Order does not have XPay capture reference.'=>'Nie można przechwycić zamówienia %s. Zamówienie nie ma odniesienia do przechwytywania XPay.','PagoDIL by Cofidis'=>'PagoDIL firmy Cofidis','Enable PagoDIL'=>'Włącz PagoDIL','Activate the PagoDIL payment method within the store.'=>'Aktywuj metodę płatności PagoDIL w sklepie.','Minimum cart value'=>'Minimalna wartość koszyka','Minimum cart value (in Euro) for which it will be possible to proceed through installment payments with PagoDIL. This value corresponds to the amount set in the XPay back office.'=>'Minimalna wartość koszyka (w euro), dla której możliwe będzie przejście do płatności ratalnych za pomocą PagoDIL. Wartość ta odpowiada kwocie ustawionej w back office XPay.','Maximum cart value'=>'Maksymalna wartość koszyka','Maximum cart value (in Euro) for which it will be possible to proceed through installment payments with PagoDIL. This value corresponds to the amount set in the XPay back office.'=>'Maksymalna wartość koszyka (w euro), dla której możliwe będzie przejście do płatności ratalnych za pomocą PagoDIL. Wartość ta odpowiada kwocie ustawionej w back office XPay.','Number of installments'=>'Liczba rat','Number of installments made available for payment via PagoDIL. The rates displayed correspond to the values set in the XPay back office.'=>'Liczba rat dostępnych do zapłaty za pośrednictwem PagoDIL. Wyświetlane stawki odpowiadają wartościom ustawionym w zapleczu XPay.','Installment products'=>'Produkty ratalne','For selected categories'=>'Dla wybranych kategorii','All categories'=>'Wszystkie kategorie','Setting up installment products:<br>- For selected categories: select the categories of products of the store that you want to set as payable in installments from the drop-down list below.<br>- All categories: all the products in the store will be configured as payable in installments.'=>'Konfigurowanie produktów ratalnych:<br>- Dla wybranych kategorii: wybierz kategorie produktów w sklepie, które chcesz ustawić jako produkty z możliwością płatności ratalnej, z poniższej listy rozwijanej.<br>- Wszystkie kategorie: wszystkie produkty w sklepie zostaną skonfigurowane jako produkty z możliwością płatności ratalnej.','Categories'=>'Kategorie','Select the categories on which you want to enable payment via PagoDIL.'=>'Wybierz kategorie, w których chcesz włączyć płatności za pośrednictwem PagoDIL.','Tax code'=>'Kod podatkowy','Select the field of your shop that corresponds to the tax code, it will be used by the plugin during the payment phase with PagoDIl: in this way the customer will not have to enter this data manually on the PagoDIL payment page.'=>'Wybierz pole swojego sklepu odpowiadające kodowi podatkowemu. Będzie on używany przez wtyczkę podczas fazy płatności w PagoDIL: dzięki temu klient nie będzie musiał ręcznie wprowadzać tych danych na stronie płatności PagoDIL.','Number of products in the cart (Optional)'=>'Liczba produktów w koszyku (opcjonalnie)','Maximum number of products in the cart for which it will be possible to proceed through installment payments with PagoDIL.'=>'Maksymalna liczba produktów w koszyku, dla której będzie można dokonać płatności ratalnej za pomocą PagoDIL.','Cofidis product code (Optional)'=>'Kod produktu Cofidis (opcjonalnie)','If you have more than one Cofidis product code, enter the code that will be used by the plugin for payment via PagoDIL.'=>'Jeśli posiadasz więcej niż jeden kod produktu Cofidis, wprowadź kod, który zostanie wykorzystany przez wtyczkę do płatności za pośrednictwem PagoDIL.','Widget PagoDIL'=>'Widżet PagoDIL','Show widget'=>'Pokaż widżet','Enable the PagoDIL widget on products that can be paid in installments. The widget shows information relating to the installment payments made available on the product.'=>'Włącz widżet PagoDIL w produktach, które można płacić ratalnie. Widget pokazuje informacje dotyczące płatności ratalnych udostępnionych dla produktu.','Number of installments displayed within the widget. It is possible to select only one value (e.g. or 5 interest-free installments).'=>'Liczba rat wyświetlanych w widżecie. Można wybrać tylko jedną wartość (np. lub 5 rat bez odsetek).','Logo type'=>'Typ logo','Select the PagoDIL logo displayed in the widget.'=>'Wybierz logo PagoDIL wyświetlane w widżecie.','"Find out more" link'=>'Link „Dowiedz się więcej”','The PagoDIL widget has an information icon pointing to a predefined web address. It is possible to change the information section by entering a new address in the form.'=>'Widżet PagoDIL ma ikonę informacyjną wskazującą na wstępnie zdefiniowany adres internetowy. Sekcję informacyjną można zmienić, wprowadzając nowy adres w formularzu.','select Tax Code Field'=>'wybierz pole Kod podatkowy','PagoDIL institutional logo'=>'Logo instytucjonalne PagoDIL','White'=>'Biały','Do you want to pay convenient installments without interest with PagoDIL by Cofidis? Reach the minimum amount 